import React from 'react';

import {AppBar, Toolbar, IconButton,Button} from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import Drawer from '../NavBarDrawer/NavBarDrawer';
import classes from './NavBar.css';



export default function NavBar() {
    const newList = [{name:'Residentes', url:'/AdminResidentes'}, {name:'menu', url:'/admin'}];
    const icon =  <MenuIcon style={{  color: '#ffffff'}}/>
        return (
            <div>
            
            <AppBar  >
                <Toolbar className={classes.root}>
                    <IconButton flexGrow={4}>
                        <Drawer  list={newList} icon={icon}/> 
                    </IconButton>
                    <Button className={classes.signOut}>Out</Button>
                </Toolbar>
            </AppBar>
            </div>
        );
    }
